// lsm-connect.bpf.c
#include "vmlinux.h"
#include <bpf/bpf_core_read.h>
#include <bpf/bpf_helpers.h>
#include <bpf/bpf_tracing.h> char LICENSE[] SEC("license") = "GPL"; #define EPERM 1
#define AF_INET 2 const __u32 blockme = 16843009; // 1.1.1.1 -> int SEC("lsm/socket_connect")
int BPF_PROG(restrict_connect, struct socket *sock, struct sockaddr *address, int addrlen, int ret)
{ // Satisfying "cannot override a denial" rule if (ret != 0) { return ret; } // Only IPv4 in this example if (address->sa_family != AF_INET) { return 0; } // Cast the address to an IPv4 socket address struct sockaddr_in *addr = (struct sockaddr_in *)address; // Where do you want to go? __u32 dest = addr->sin_addr.s_addr; bpf_printk("lsm: found connect to %d", dest); if (dest == blockme) { bpf_printk("lsm: blocking %d", dest); return -EPERM; } return 0;
} 这是一段 C 实现的 eBPF 内核侧代码，它会阻碍所有试图通过 socket 对 1.1.1.1 的连接操作，其中： SEC("lsm/socket_connect") 宏指出该程序期望的挂载点； 程序通过 BPF_PROG 宏定义（详情可查看 tools/lib/bpf/bpf_tracing.h ）； restrict_connect 是 BPF_PROG 宏要求的程序名； ret 是该挂载点上（潜在的）当前函数之前的 LSM 检查程序的返回值； 整个程序的思路不难理解： 首先，若其他安全检查函数返回值不为 0（不通过），则无需检查，直接返回不通过； 接下来，判断是否为 IPV4 的连接请求，并比较试图连接的地址是否为 1.1.1.1； 若请求地址为 1.1.1.1 则拒绝连接，否则允许连接； 在程序运行期间，所有通过 socket 的连接操作都会被输出到 /sys/kernel/debug/tracing/trace_pipe。

