我们在用户态的 eBPF 程序中主要进行了以下几个操作： 打开 eBPF 程序。 设置我们想要隐藏的进程的 PID。 验证并加载 eBPF 程序。 等待并处理由 eBPF 程序发送的事件。 首先，我们打开了 eBPF 程序。这个过程是通过调用 pidhide_bpf__open 函数实现的。如果这个过程失败了，我们就直接返回。 skel = pidhide_bpf__open(); if (!skel) { fprintf(stderr, "Failed to open BPF program: %s
", strerror(errno)); return 1; } 接下来，我们设置了我们想要隐藏的进程的 PID。这个过程是通过将 PID 保存到 eBPF 程序的 rodata 区域实现的。默认情况下，我们隐藏的是当前进程。 char pid_to_hide[10]; if (env.pid_to_hide == 0) { env.pid_to_hide = getpid(); } sprintf(pid_to_hide, "%d", env.pid_to_hide); strncpy(skel->rodata->pid_to_hide, pid_to_hide, sizeof(skel->rodata->pid_to_hide)); skel->rodata->pid_to_hide_len = strlen(pid_to_hide) + 1; skel->rodata->target_ppid = env.target_ppid; 然后，我们验证并加载 eBPF 程序。这个过程是通过调用 pidhide_bpf__load 函数实现的。如果这个过程失败了，我们就进行清理操作。 err = pidhide_bpf__load(skel); if (err) { fprintf(stderr, "Failed to load and verify BPF skeleton
"); goto cleanup; } 最后，我们等待并处理由 eBPF 程序发送的事件。这个过程是通过调用 ring_buffer__poll 函数实现的。在这个过程中，我们每隔一段时间就检查一次环形缓冲区中是否有新的事件。如果有，我们就调用 handle_event 函数来处理这个事件。 printf("Successfully started!
");
printf("Hiding PID %d
", env.pid_to_hide);
while (!exiting)
{ err = ring_buffer__poll(rb, 100 /* timeout, ms */); /* Ctrl-C will cause -EINTR */ if (err == -EINTR) { err = 0; break; } if (err < 0) { printf("Error polling perf buffer: %d
", err); break; }
} handle_event 函数中，我们根据事件的内容打印了相应的消息。这个函数的参数包括一个上下文，事件的数据，以及数据的大小。我们首先将事件的数据转换为 event 结构体，然后根据 success 字段判断这个事件是否表示成功隐藏了一个进程，最后打 印相应的消息。 static int handle_event(void *ctx, void *data, size_t data_sz)
{ const struct event *e = data; if (e->success) printf("Hid PID from program %d (%s)
", e->pid, e->comm); else printf("Failed to hide PID from program %d (%s)
", e->pid, e->comm); return 0;
} 这段代码展示了如何在用户态使用 eBPF 程序来实现进程隐藏的功能。我们首先打开 eBPF 程序，然后设置我们想要隐藏的进程的 PID，再验证并加载 eBPF 程序，最后等待并处理由 eBPF 程序发送的事件。这个过程中，我们使用了 eBPF 提供的一些高级功能，如环形缓冲区和事件处理，这些功能使得我们能够在用户态方便地与内核态的 eBPF 程序进行交互。 完整源代码： https://github.com/eunomia-bpf/bpf-developer-tutorial/tree/main/src/24-hide 本文所示技术仅为概念验证，仅供学习使用，严禁用于不符合法律法规要求的场景。

