Syntax: LSM_PROBE( hook , typeof(arg1) arg1, typeof(arg2) arg2 ...) This is a macro that instruments an LSM hook as a BPF program. It can be used to audit security events and implement MAC security policies in BPF. It is defined by specifying the hook name followed by its arguments. Hook names can be found in include/linux/security.h by taking functions like security_hookname and taking just the hookname part. For example, security_bpf would simply become bpf. Unlike other BPF program types, the return value specified in an LSM probe matters. A return value of 0 allows the hook to succeed, whereas any non-zero return value will cause the hook to fail and deny the security operation. The following example instruments a hook that denies all future BPF operations: LSM_PROBE(bpf, int cmd, union bpf_attr *attr, unsigned int size)
{ return -EPERM;
} This instruments the security_bpf hook and causes it to return -EPERM. Changing return -EPERM to return 0 would cause the BPF program to allow the operation instead. LSM probes require at least a 5.7+ kernel with the following configuation options set: CONFIG_BPF_LSM=y CONFIG_LSM comma separated string must contain "bpf" (for example, CONFIG_LSM="lockdown,yama,bpf") Examples in situ: search /tests

