在本章节中，我们将分析tcprtt eBPF 程序的内核态代码。tcprtt是一个用于测量 TCP 往返时间(Round Trip Time, RTT)的程序，它将 RTT 的信息统计到一个 histogram 中。 /// @sample {"interval": 1000, "type" : "log2_hist"}
struct { __uint(type, BPF_MAP_TYPE_HASH); __uint(max_entries, MAX_ENTRIES); __type(key, u64); __type(value, struct hist);
} hists SEC(".maps"); static struct hist zero; SEC("fentry/tcp_rcv_established")
int BPF_PROG(tcp_rcv, struct sock *sk)
{ const struct inet_sock *inet = (struct inet_sock *)(sk); struct tcp_sock *ts; struct hist *histp; u64 key, slot; u32 srtt; if (targ_sport && targ_sport != inet->inet_sport) return 0; if (targ_dport && targ_dport != sk->__sk_common.skc_dport) return 0; if (targ_saddr && targ_saddr != inet->inet_saddr) return 0; if (targ_daddr && targ_daddr != sk->__sk_common.skc_daddr) return 0; if (targ_laddr_hist) key = inet->inet_saddr; else if (targ_raddr_hist) key = inet->sk.__sk_common.skc_daddr; else key = 0; histp = bpf_map_lookup_or_try_init(&hists, &key, &zero); if (!histp) return 0; ts = (struct tcp_sock *)(sk); srtt = BPF_CORE_READ(ts, srtt_us) >> 3; if (targ_ms) srtt /= 1000U; slot = log2l(srtt); if (slot >= MAX_SLOTS) slot = MAX_SLOTS - 1; __sync_fetch_and_add(&histp->slots[slot], 1); if (targ_show_ext) { __sync_fetch_and_add(&histp->latency, srtt); __sync_fetch_and_add(&histp->cnt, 1); } return 0;
} 首先，我们定义了一个 hash 类型的 eBPF map，名为hists，它用来存储 RTT 的统计信息。在这个 map 中，键是 64 位整数，值是一个hist结构，这个结构包含了一个数组，用来存储不同 RTT 区间的数量。 接着，我们定义了一个 eBPF 程序，名为tcp_rcv，这个程序会在每次内核中处理 TCP 收包的时候被调用。在这个程序中，我们首先根据过滤条件（源/目标 IP 地址和端口）对 TCP 连接进行过滤。如果满足条件，我们会根据设置的参数选择相应的 key（源 IP 或者目标 IP 或者 0），然后在hists map 中查找或者初始化对应的 histogram。 接下来，我们读取 TCP 连接的srtt_us字段，这个字段表示了平滑的 RTT 值，单位是微秒。然后我们将这个 RTT 值转换为对数形式，并将其作为 slot 存储到 histogram 中。 如果设置了show_ext参数，我们还会将 RTT 值和计数器累加到 histogram 的latency和cnt字段中。 通过以上的处理，我们可以对每个 TCP 连接的 RTT 进行统计和分析，从而更好地理解网络的性能状况。 总结起来，tcprtt eBPF 程序的主要逻辑包括以下几个步骤： 根据过滤条件对 TCP 连接进行过滤。 在hists map 中查找或者初始化对应的 histogram。 读取 TCP 连接的srtt_us字段，并将其转换为对数形式，存储到 histogram 中。 如果设置了show_ext参数，将 RTT 值和计数器累加到 histogram 的latency和cnt字段中。 tcprtt 挂载到了内核态的 tcp_rcv_established 函数上： void tcp_rcv_established(struct sock *sk, struct sk_buff *skb); 这个函数是在内核中处理TCP接收数据的主要函数，主要在TCP连接处于ESTABLISHED状态时被调用。这个函数的处理逻辑包括一个快速路径和一个慢速路径。快速路径在以下几种情况下会被禁用： 我们宣布了一个零窗口 - 零窗口探测只能在慢速路径中正确处理。 收到了乱序的数据包。 期待接收紧急数据。 没有剩余的缓冲区空间。 接收到了意外的TCP标志/窗口值/头部长度（通过检查TCP头部与预设标志进行检测）。 数据在两个方向上都在传输。快速路径只支持纯发送者或纯接收者（这意味着序列号或确认值必须保持不变）。 接收到了意外的TCP选项。 当这些条件不满足时，它会进入一个标准的接收处理过程，这个过程遵循RFC793来处理所有情况。前三种情况可以通过正确的预设标志设置来保证，剩下的情况则需要内联检查。当一切都正常时，快速处理过程会在tcp_data_queue函数中被开启。

